<pre><code>            {
                "_id" : ObjectId("5b5e5107b3218221345cb198"),
                "category" : "A",
                "type" : "toilet",
                "cleaned" : "yes",
                "date" : ISODate("2018-07-29T23:43:03.178+0000")
            }
            {
                "_id" : ObjectId("5b5e5119b3218221345cb199"),
                "category" : "B",
                "housed" : "no",
                "temp" : "44",
                "date" : ISODate("2018-08-10T10:22:22.774+0000")
            }
</code></pre>

<p>I am trying to group and paginate. I need to be able to group all the documents by date - ignoring the time. This way, I can display all documents belonging to a date.</p>

<p>When a viewer clicks next / previous, it shows the next / previous date etc... So I would need to also test to see if next and previous documents exist in order to build the pagination.</p>

<p>So far, my attempts have failed. My thoughts are - I need to find and group, but that didn't work. I read this blog post <a href="https://dzone.com/articles/aggregate-mongo-using-only" rel="nofollow noreferrer">https://dzone.com/articles/aggregate-mongo-using-only</a> and adapted it - but this also doesn't work... it returns only a date field (the datePartDay bit splits the date string up)</p>

<pre><code>        db.getCollection("log").aggregate(
            {
                "$project":
                    {
                        _id: 0,
                        "datePartDay": {
                            "$concat": [
                                {"$substr": [{"$dayOfMonth": "$date"}, 0, 2]}, "-",
                                {"$substr": [{"$month": "$date"}, 0, 2]}, "-",
                                {"$substr": [{"$year": "$date"}, 0, 4]}
                            ]
                        }
                    }
            },
            {
                "$group":
                    {"date": "$datePartDay"}
            }
        )
</code></pre>

<p>My app is running on node - and I'm not using mongoose.</p>

<p>** EDIT **</p>

<p>@Anthony Winzlet</p>

<p>I couldn't get $slice to work - but I can set my match to only look within 3 days, thus limiting my results to only those which fall within 3 days.</p>

<pre><code>db.collection.aggregate(
[
    { 
        "$match" : {
        // find the date range we want to look up
            "date" : {
                "$gte" : ISODate("2018-07-29T00:00:00.000+0000"),
                 "$lte" : ISODate("2018-09-10T00:00:00.000+0000")
            }
        }
    }, 
    { 
        "$group" : {
            "_id" : {
                "$dateToString" : {
                    "format" : "%Y-%m-%d", 
                    "date" : "$date"
                }
            }, 
            "data" : {
                "$push" : "$$ROOT"
            }
        }
    }
]
);
</code></pre>

<p>However, I'm not sure how performant this is?</p>

