<pre><code>const userSchema = new Schema({
    googleId: String,
    displayName: String,
    sessions: Array
});
</code></pre>

<p>It works and gets updated but if I try submitting around 6 or 7 items to the database, it stops and when i try to refresh the page, it takes like a minute or two to actually refresh. Why is it doing this? Is there a limit on how many times I can update the database per minute or something? Here's the post route</p>

<pre><code>app.post('/api/addToDatabase', (req, res) =&gt; {
        //console.log(req.body)
        User.findById(req.user._id, function (err, user) {
            user.sessions.push(req.body);
            user.save();
        })
    })
</code></pre>

