MongoDB group data melt<p>Say I have a small dataset:</p>

<pre><code>[
    {"A": 0, "B": 0, "X": 100, "Y": 100},
    {"A": 1, "B": 0, "X": 50, "Y": 55},
    {"A": 0, "B": 1, "X": 25, "Y": 30},
    {"A": 1, "B": 1, "X": 1, "Y": 6}
]
</code></pre>

<p>I also have a pipeline where the final stage is a group:</p>

<pre><code>[
    {
        "$group": {
            "_id": {
                "classification1": {
                    "$eq": ["$A", 1]
                },
                "classification2": {
                    "$eq": ["$B", 1]
                }
            },
            "countX": {"$sum": "$X"},
            "countY": {"$sum": "$Y"}
        }
    }
]
</code></pre>

<p>The output of this pipeline:</p>

<pre><code>[
    {"_id": {"classification1": false, "classification2": false}, "countX": 100, "countY": 100},
    {"_id": {"classification1": true, "classification2": false}, "countX": 50, "countY": 55},
    {"_id": {"classification1": false, "classification2": true}, "countX": 25, "countY": 30},
    {"_id": {"classification1": true, "classification2": true}, "countX": 1, "countY": 6}
]
</code></pre>

<p>What pipeline steps would I need to reach a melted format like this?</p>

<pre><code>[
    {"name": "classification1", "countX": 51, "countY": 61},
    {"name": "classification2", "countX": 26, "countY": 36}
]
</code></pre>

<p>Note that this transformation counts document 1 from the previous stage zero times, and counts document 4 twice (since both conditions are false, or both are true).</p>

<p>I have written a Javascript function for this, but Javascript functions cannot be invoked from the pipeline (aggregation pipelines must be serializable). Unfortunately, that means I have to unload the data from the DB, run the script on the data, and then load the transformed data back in as a temporary collection to finish the rest of the pipeline after this stage.</p>

<p>Any assistance is greatly appreciated.</p>

